import React from "react";

import DashboardHeader from "../components/dashboard/DashboardHeader";
import Option from "../components/dashboard/Option";
import ProductTable from "../components/dashboard/ProductTable";

const Dashboard = () => {
  return (
    <div className="py-20">
      <DashboardHeader />
      <section className="bg-gray-50 h-72">
        <div className="relative items-center w-full  px-5 py-12 mx-auto md:px-12 lg:px-52 max-w-7xl">
          <div className="grid w-full grid-cols-2 gap-6 mx-auto lg:grid-cols-2 ">
              <Option optionTitle={'Create User'}/>
              <Option optionTitle={'Add Product'}/>
              <Option optionTitle={'Update Socials'}/>
              <Option optionTitle={'Update Service'}/>
          </div>
        </div>
      </section>

      {/* Products table for Flowers And Bouquets */}
      <section>
          <ProductTable/>
          <ProductTable/>
      </section>
    </div>
  );
};

export default Dashboard;
